      <div>
      <span className={exceededModal.limitsitems}>{queryData} :</span>
      </div>
      <div>
        <b className={limit <= usage ? "colorRose" : "colorBlack"}>{usage}</b>{" "}
        out of
      </div>
      <div>
        <b>{limit}</b>
      </div>
    </div>
  );
};
